              placeholder="Cari Pesanan"
              InputProps={{
                startAdornment: (
                  <SearchIcon
                    sx={{
                      marginRight: "12px",
                      color: THEME.GREY_PRIMARY,
                      fontSize: "16px",
                    }}
                  />
                ),
                disableUnderline: true,
              }}
              sx={{
                input: { fontWeight: 500, fontSize: "12px", marginTop: "2px" },
                backgroundColor: "#F5F5F5",
                height: "42px",
                display: "flex",
                justifyContent: "center",
                paddingLeft: "18px",
                paddingRight: "16px",
                borderRadius: "8px",
