                  <Typography sx={{ fontWeight: 700, fontSize: "14px" }}>
                    Rp. 79.000
                  </Typography>
                  <StyledButton
                    text={"Lacak"}
                    style="outlined"
                    noShadow
                    border="1px solid #2DBE78"
                    width={"54px"}
                    height="23px"
                    borderRadius={"4px"}
                    fontSize="10px"
                  />
                </Box>

