                    <Typography
                      sx={{ fontWeight: 500, fontSize: "12px", ml: "30px" }}
                    >
                      Simangan
                    </Typography>
                    <Box sx={{ background: THEME.GREEN_PRIMARY, borderRadius: "4px" }}>
                      <Typography
                        sx={{
                          fontWeight: 600,
                          fontSize: "10px",
                          width: "167px",
                          height: "23px",
                          alignItems: "center",
                          display: "flex",
                          justifyContent: "center",
                          color: "white",
                        }}
